import Link from 'next/Link';

const Navbar = () => (
  <nav id="navbar">
    <div className="container">
      <div id="logo">
        <Link href="/">
          <a>
            <h1>CodeTunes</h1>
          </a>
        </Link>
      </div>
      <ul id="nav-menu">
        <Link href="/about">
          <a className="nav-link">About</a>
          </Link>
      </ul>
    </div>

    <style jsx>{`
    
      #navbar {
        display: flex;
        justify-content: space-between;
        padding-top: 1.5rem;
      }

      #logo h1 {
        color: white;
        font-size: 2rem;
      }

      .nav-link {
        color: white;
      }



      



    `}</style>
  </nav>
)

export default Navbar;
